import React from 'react';

function WinnerResults({ winner, startGame }) {
    return (
        <div className="popup">
            <div className="popup-content">
                <div className="popup-text">
                    {winner ? (winner === 'Draw' ? "It's a Draw!" : 'Winner: ' + winner) : 'Next player: '}
                </div>
                <button className="start-new-game" onClick={startGame}>
                    Начать новую игру
                </button>
            </div>
        </div>
    );
}

export default WinnerResults;
